import Navbar from "./component/Navbar";
import Hero from "./component/Hero";
import Demo from "./component/Demo";
import "./App.css";

function App() {
  return (
    <>
      <div className="App">
        <Navbar />
        <Hero />
        <Demo />
      </div>
    </>
  );
}

export default App;
